import React from 'react';
import './styleNavMenu.css';


const MenuItem = (props) => {
    const { name, category } = props;

    return (
        <div>
            <li className='item'>
                <h3>{name}</h3>
                {/* <a href={category}>{name}</a> */}
            </li>
        </div> 
    )

}

export default MenuItem;
